import './App.css';
import { Container, Row, Col } from "reactstrap";

function App() {

  return (
    <div>
      <Container>
        <Row>
          <Col
            className="bg-light border"
            xs="6"
          >
            .col-6
          </Col>
          <Col
            className="bg-light border"
            xs="6"
          >
            .col-6
          </Col>
        </Row>
      </Container>

    </div>

  );
}

export default App;
